DROP TABLE IF EXISTS `xmlrpc`.`country` ;

CREATE  TABLE IF NOT EXISTS `xmlrpc`.`country` (
  `country_id` BIGINT UNSIGNED NOT NULL AUTO_INCREMENT ,
  `iso` CHAR(2) NULL ,
  `country_name` VARCHAR(150) NOT NULL ,
  `printable_name` VARCHAR(150) NOT NULL ,
  `iso3` CHAR(3) NULL ,
  `numcode` SMALLINT NULL ,
  PRIMARY KEY (`country_id`) )
ENGINE = MyISAM
DEFAULT CHARACTER SET = utf8
COLLATE = utf8_general_ci;




